import { Component } from 'react';

import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor(){
    super();

    this.state = {
      monsters:  [
        {
          name: 'Linda',
          id : '2333'
        }, 
        {
          name: 'Frank',
          id : 'ddd33'
        },
        {
          name: 'Jacky',
          id : 'hh7z7hh'
        },{
          name: 'Andrei',
          id : 'hhhh888'
        }
      ]
    }
  }

  render() {
     return  (
        <div className="App">
          {
            this.state.monsters.map((monster) => {
              return (
                <div key={monster.id}>
                       <h1>{monster.name}</h1>
                  </div>
              ); 
            })
          }
        </div>
     );
  } 
}

export default App;
